<!DOCTYPE html>
<html>
    <head>
        <meta charset="utf-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
        <meta property="og:title" content="Curriculum Object Page">
        <meta property="og:description" content="My Curriculum displayed using SAP Object Page Fiori Floorplan">
        <meta property="og:image" content="https://www.sap.com/content/dam/application/shared/logos/sap-logo-svg.svg">
        <meta property="og:url" content="https://juanfelipe82193.github.io/object-page/">
        <title>Personal Object Page</title>
        <link href="./img/1493030643828.svg" rel="shortcut icon" type="image/x-icon" />
        <script
            id="sap-ui-bootstrap"
            src="https://sapui5.hana.ondemand.com/resources/sap-ui-core.js"
            data-sap-ui-theme="sap_fiori_3"
            data-sap-ui-resourceroots='{"my.page.object": "./"}'
            data-sap-ui-compatVersion="edge"
            data-sap-ui-oninit="module:sap/ui/core/ComponentSupport"
            data-sap-ui-async="true"
			data-sap-ui-preload="async"
            data-sap-ui-frameOptions="trusted"
        ></script>
    </head>
    <body class="sapUiBody">
        <div
            data-sap-ui-component
            data-name="my.page.object"
            data-id="container"
            data-settings='{"id" : "object"}'>
        </div>
    </body>
</html>
